import React from 'react';
import './LoadingCircle.css'; // Import the CSS file for styling

const LoadingCircle = () => {
  return (
    <div className="loading-circle-container">
    	<div className="loading-circle"></div>
    </div>
  );
};

export default LoadingCircle;
